import Card  from './Card'
import {productsUrl} from '../axios/productsApi'
import axios from 'axios'
function Products() {
    useEffect(()=>{
        axios.get(productsUrl)
        .then()
    } , [])

  return (
    <Card/>
  )
}

export default Products
